import React, { useRef } from 'react';

function Projects() {
  // Use useRef to get a reference to the projects container
  const projectsRef = useRef(null);

  // Function to handle scrolling
  const scrollProjects = (direction) => {
    const container = projectsRef.current;
    const scrollAmount = 300; // Amount to scroll on each button click
    if (direction === 'left') {
      container.scrollBy({
        left: -scrollAmount,
        behavior: 'smooth',
      });
    } else {
      container.scrollBy({
        left: scrollAmount,
        behavior: 'smooth',
      });
    }
  };

  return (
    <section className="portfolio-section" id="projects">
      <h2>Projects</h2>
      <p>The code repository for my portfolio website can be accessed by clicking the button below.</p>
      <a className="btn" href="https://github.com/athul-tmp/portfolio" target="_blank" rel="noopener noreferrer">GitHub Repo</a>
      <br /><br />
      <p>The following are the projects that I've been involved in over the years:</p>
      <hr />

      {/* Scrollable Projects Container */}
      <div className="projects-container">
        <button className="scroll-btn left-btn" onClick={() => scrollProjects('left')}>&#8249;</button>
        <div className="projects-list" ref={projectsRef}>
          {/* Project 1 */}
          <div className="project-card">
            <h3>Music Subscription App | HTML, CSS, Javascript, PHP, AWS (S3, DynamoDB, EC2)</h3>
            <div className="project-content">
              <img src="assets/Music_App.png" alt="Image of Music App's the main page after login" />
              <div className="project-info">
                <p>A dynamic web application created with HTML, CSS, JavaScript, and PHP, hosted on AWS EC2. The app uses DynamoDB for user authentication and registration. AWS S3 is used for scalable image storage.</p>
                <p>The design focuses on performance, scalability, and cross-browser compatibility.</p>
                <a className="btn" href="https://drive.google.com/file/d/1yiK10mySCjGmvhRxm1KdEPc5Br41N_mn/view?usp=sharing" target="_blank" rel="noopener noreferrer">Video Demo</a>
              </div>
            </div>
          </div>

          {/* Project 2 */}
          <div className="project-card">
            <h3>Vacuum Cleaner Game | C++</h3>
            <div className="project-content">
              <img src="assets/Vacuum_Cleaner.png" alt="Image of the vacuum cleaner game board" />
              <div className="project-info">
                <p>Developed a vacuum cleaner game in C++ using OOP principles with a command-line interface. The game uses a 10x10 grid and allows players to navigate using text-based commands.</p>
                <a className="btn" href="https://drive.google.com/file/d/1ZJcLrHsDaiwb9Wh05ghvfdG1gYi3tXLq/view?usp=sharing" target="_blank" rel="noopener noreferrer">Video Demo</a>
              </div>
            </div>
          </div>

          {/* Project 3 */}
          <div className="project-card">
            <h3>Minecraft Village Generator | Python</h3>
            <div className="project-content">
              <img src="assets/Minecraft_Village.png" alt="Image of the generated minecraft village" />
              <div className="project-info">
                <p>A procedural Minecraft village generator in Python using the MCPI library. The project employs recursion for dynamically generating rooms within houses and connects them with pathways, generating trees to enhance the village's appearance.</p>
                <a className="btn" href="https://github.com/athul-tmp/Minecraft-Village-Generator" target="_blank" rel="noopener noreferrer">GitHub Repo</a>
                <a className="btn" href="https://www.youtube.com/watch?v=raSy0x0HETk" target="_blank" rel="noopener noreferrer">Video Demo</a>
              </div>
            </div>
          </div>

          {/* Add more projects here */}
        </div>
        <button className="scroll-btn right-btn" onClick={() => scrollProjects('right')}>&#8250;</button>
      </div>
    </section>
  );
}

export default Projects;
